  Average of Hydraulic Conductivity and Specific Yield for the Northern High Plains
  Groundwater-Flow Model in Parts of Colorado, Kansas, Nebraska, South Dakota, and
  Wyoming\",\n\t\"tracking_summary\": {\n\t\t\"total\": 59,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
